import React, { Component } from 'react';
class Nav extends Component{
    render(){
        return(
            <nav>
                <ul>
                    <li>
                        <link to="/buscarterminos" className="">Items</link>
                    </li>
                </ul>
            </nav>
        );
    }

}
export default Nav;
